import React from 'react';

const ImgLinkForm = () => {
    return (
        <div>
            <p className='f3'>
                { 'This magic brain detect faces on images. Just give it a try.' }
            </p>
            <input type='text' />
            <button>Detect</button>
        </div>
    )
}

export default ImgLinkForm;
